let input =
"""

"""

let alphabet = Set(input.lowercased()).sorted()

let res = alphabet.reduce([Character: Int]()) { (dict, c) -> [Character: Int] in
    let newPolymer = input.filter { String(c).caseInsensitiveCompare(String($0)) != ComparisonResult.orderedSame }
    let count = newPolymer.reduce("") { (x, y) in
        let last = x.isEmpty ? "" : String(x.last!)
        let next = String(y)
        if last.caseInsensitiveCompare(next) == ComparisonResult.orderedSame && last != String(next) {
            //        print(x, y)
            return String(String(x).dropLast())
        }
        
        return x + String(y)
    }.count
    
    var dict = dict
    dict[c] = count
    return dict
}

print(res.values.min()!)
